# Load Our Dataset
def load_data(data):
	df = pd.read_csv(data)
	return df 

# Vectorize + Cosine Similarity Matrix

def vectorize_text_to_cosine_mat(data):
	count_vect = CountVectorizer()
	cv_mat = count_vect.fit_transform(data)
	# Get the cosine
	cosine_sim_mat = cosine_similarity(cv_mat)
	return cosine_sim_mat


# Recommendation Sys
@st.cache
def get_recommendation(title,cosine_sim_mat,df,num_of_rec=10):
	# indices of the course
	song_indices = pd.Series(df.index,index=df['song_title']).drop_duplicates()
	# Index of course
	idx = song_indices[title]

	# Look into the cosine matr for that index
	sim_scores =list(enumerate(cosine_sim_mat[idx]))
	sim_scores = sorted(sim_scores,key=lambda x: x[1],reverse=True)
	selected_course_indices = [i[0] for i in sim_scores[1:]]
	selected_course_scores = [i[0] for i in sim_scores[1:]]

	# Get the dataframe & title
	result_df = df.iloc[selected_song_indices]
	result_df['similarity_score'] = selected_song_scores
	final_recommended_courses = result_df[['song_title']]
	return final_recommended_courses.head(num_of_rec)



